import { NavLink } from "react-router-dom";
function RightFoot()
{
    return (
        <>
        <div class="col-sm-6">
            <h3>CÔNG TY TNHH RECESS</h3>
            <label>Giấy CNĐKDN: 0308808576 – Ngày cấp: 06/5/2009, được sửa đổi lần thứ 19 ngày 15/8/2019.
                    Cơ quan cấp: Phòng Đăng ký kinh doanh – Sở kế hoạch và Đầu tư TP.HCM
                    Địa chỉ đăng ký kinh doanh: Tầng 19, Tòa nhà Saigon Centre – Tháp 2, 67 Lê Lợi, Phường Bến Nghé, Quận 1, Tp. Hồ Chí Minh, Việt Nam.</label>
        </div>
        </>
    )
}

export default RightFoot;
